import { BrowserRouter, Switch, Route } from "react-router-dom";
import Navbar from "./Navbar.js";
import Home from "./Home.js";
import About from "./About.js";
import Products from "./Products.js";
import ProductDetails from "./ProductDetails.js";
import Cart from "./Cart.js";
import {useContext} from 'react';
import {AppProvider, AppContext} from './AppContext.js';
function App() {

  const context = useContext(AppContext);
  console.log(context)

  return (<AppProvider>
    <BrowserRouter>
      <Navbar cart={context.cart} />
      <div className="container">
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route exact path="/about">
            <About />
          </Route>
          <Route exact path="/products">
            <Products
              cart={context.cart}
              onProductAdd={context.onProductAdd}
              onProductDelete={context.onProductDelete}
            />
          </Route>
          <Route path="/products/:id">
            <ProductDetails onProductAdd={context.onProductAdd} />
          </Route>
          <Route exact path="/cart">
            <Cart cart={context.cart} />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
    </AppProvider>
  );
}

export default App;
